import React from 'react';

import styled from "styled-components";

const H = styled.div `
    text-align:left;
    width:300px;
    height:300px;
    background-color: black;
    font-size: 20;
    padding: 10px; /* 내부 여백 설정 */
    color: white;
    `


const Header = () => {
    return (
        <H>
            <h1>album</h1>
        </H>
    );
};

export default Header;
